BEGIN TRANSACTION;
pragma foreign_keys=on;

        create table if not exists centros_region (
            codigo_centro char(10) primary key,
            nombre_centro char(120),
            codigo_localidad char(10),
            direccion_postal char(120),
            codigo_postal   char(6),
            tlf             char(20),
            fax             char(20),
            email           char(140),
            web             char(140),
            naturaleza      char(20),
            tipo_centro     char(20),
            foreign key (codigo_localidad) references localidades(codigo_localidad)
                on delete cascade on update cascade
        );

            create index if not exists idx_nombre_centro_region on  centros_region (codigo_centro)
        ;
pragma foreign_keys=on;

            create table if not exists ensenanzas_region (
                nombre              char(120) primary key,
                regimen             char(25),
                unidades            integer,
                puestos             integer,
                uds_concertadas     integer,
                fecha               date,
                codigo_centro       char(10),
                foreign key (codigo_centro) references centros_region
                    on delete cascade on update cascade
            )
        ;

            create index if not exists idx_ensenanza_region on ensenanzas_region(nombre)
        ;
